import SHOP_DATA from './shopdata';
import CollectionPreview from '../../components/preview-comp/collection-preview'

class ShopPage extends React.Component{
    constructor(props){
        super(props);
        this.state={
        collection:SHOP_DATA
    }
    }
    
    render(){
        return(
            <div>
            <CollectionPreview items={this.state.collection} title='Shop Page'/>
                </div>
        )
    }
}
export default ShopPage;
